export type IconProps = JSX.IntrinsicElements['svg']

export function Icon({
  fill,
  stroke,
  className,
  children,
  viewBox = '0 0 20 20',
  ...props
}: IconProps) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox={viewBox}
      fill={fill}
      stroke={stroke}
      className={className}
      {...props}
    >
      {children}
    </svg>
  )
}

